import React,{useEffect,useState} from 'react'
import { Card,CardContent,Typography } from '@material-ui/core'

const Post = () => {
    const[posts, setposts]=useState([])
    useEffect(() => {
        const url="https://jsonplaceholder.typicode.com/posts"
        fetch(url)
        .then(response=>response.json())
        .then(response=>setposts(response))
    }, [])
    return (
        <>
       <Card className="infoBox">
              <CardContent>
                  <Typography className="infoBox_title" color="textSecondary">Posts</Typography>
                  {posts.map(post=><>
                  <h2 className="infoBox_cases">{`${post.id}. ${post.title}`}</h2>
                  <Typography className="infoBox_total"  color="textSecondary">{post.body}</Typography>
                  </>)}
              </CardContent>
          </Card>  
        </>
    )
}

export default Post
